import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { Box, Grid, Typography, Button, Card, CardMedia, CardContent } from '@mui/material';
import '../styles/OutfitCreator.css';

const OutfitCreator = () => {
  const [currentOutfit, setCurrentOutfit] = useState(0);
  const [outfits, setOutfits] = useState([]);
  const [selectedItems, setSelectedItems] = useState([]);
  const [clothingItems, setClothingItems] = useState([]);

  useEffect(() => {
    // Fetch clothing items from your backend
    fetch('http://localhost:8080/api/clothes')
      .then(response => response.json())
      .then(data => setClothingItems(data))
      .catch(error => console.error('Error fetching clothes:', error));
  }, []);

  const handleSwipe = (direction) => {
    if (outfits.length === 0) return;
    if (direction === 'left') {
      setCurrentOutfit((prev) => (prev + 1) % outfits.length);
    } else {
      setCurrentOutfit((prev) => (prev - 1 + outfits.length) % outfits.length);
    }
  };

  const addItemToOutfit = (item) => {
    setSelectedItems(prev => {
      // Check if item is already selected
      if (prev.some(i => i.id === item.id)) {
        return prev;
      }
      return [...prev, item];
    });
  };

  const removeItemFromOutfit = (itemId) => {
    setSelectedItems(prev => prev.filter(item => item.id !== itemId));
  };

  const saveOutfit = () => {
    if (selectedItems.length > 0) {
      setOutfits(prev => [...prev, { items: selectedItems }]);
      setSelectedItems([]);
    }
  };

  return (
    <div className="outfit-creator">
      <Typography variant="h4" gutterBottom sx={{ color: '#ff69b4' }}>
        Create Your Outfits
      </Typography>

      <Box className="outfit-display" sx={{ mb: 4 }}>
        <AnimatePresence mode="wait">
          {outfits.length > 0 && (
            <motion.div
              key={currentOutfit}
              initial={{ x: 300, opacity: 0 }}
              animate={{ x: 0, opacity: 1 }}
              exit={{ x: -300, opacity: 0 }}
              transition={{ type: "spring", stiffness: 300, damping: 30 }}
              className="outfit-card"
            >
              <Grid container spacing={2}>
                {outfits[currentOutfit].items.map((item, index) => (
                  <Grid item xs={6} sm={4} md={3} key={index}>
                    <Card>
                      <CardMedia
                        component="img"
                        height="200"
                        image={item.imageUrl || 'https://via.placeholder.com/200'}
                        alt={item.name}
                      />
                      <CardContent>
                        <Typography variant="body2">{item.name}</Typography>
                      </CardContent>
                    </Card>
                  </Grid>
                ))}
              </Grid>
            </motion.div>
          )}
        </AnimatePresence>

        {outfits.length > 0 && (
          <Box className="swipe-buttons" sx={{ mt: 2 }}>
            <Button onClick={() => handleSwipe('right')} variant="contained">←</Button>
            <Button onClick={() => handleSwipe('left')} variant="contained">→</Button>
          </Box>
        )}
      </Box>

      <Box className="outfit-builder" sx={{ mt: 4 }}>
        <Typography variant="h5" gutterBottom>Build New Outfit</Typography>

        <Box className="selected-items" sx={{ mb: 4 }}>
          <Grid container spacing={2}>
            {selectedItems.map((item, index) => (
              <Grid item xs={6} sm={4} md={3} key={index}>
                <Card>
                  <CardMedia
                    component="img"
                    height="200"
                    image={item.imageUrl || 'https://via.placeholder.com/200'}
                    alt={item.name}
                  />
                  <CardContent>
                    <Typography variant="body2">{item.name}</Typography>
                    <Button 
                      size="small" 
                      color="secondary" 
                      onClick={() => removeItemFromOutfit(item.id)}
                    >
                      Remove
                    </Button>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Box>

        <Typography variant="h6" gutterBottom>Your Closet</Typography>
        <Grid container spacing={2}>
          {clothingItems.map((item) => (
            <Grid item xs={6} sm={4} md={3} key={item.id}>
              <Card 
                sx={{ 
                  cursor: 'pointer',
                  transition: '0.3s',
                  '&:hover': { transform: 'translateY(-5px)' }
                }}
                onClick={() => addItemToOutfit(item)}
              >
                <CardMedia
                  component="img"
                  height="200"
                  image={item.imageUrl || 'https://via.placeholder.com/200'}
                  alt={item.name}
                />
                <CardContent>
                  <Typography variant="body2">{item.name}</Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>

        <Button 
          className="save-outfit-btn"
          variant="contained"
          onClick={saveOutfit}
          disabled={selectedItems.length === 0}
          sx={{ mt: 3 }}
        >
          Save Outfit
        </Button>
      </Box>
    </div>
  );
};

export default OutfitCreator;
